import React from 'react';
import './fonds.css';
import Switch from '../switch/Switch';
import FondElem from './fond_list/FondElem';
import CategoryReport from '../CategoryReport';

const Fonds = () => {
  return (
    <div className="fonds">
      <CategoryReport />
      <h1 className="primary_title">Фонды</h1>
      <div className="content_sales">
        <div className="sales">
          <div className="title_date_box">
            <h1 className="title">Объем продаж</h1>
            <h2 className="date">18.01.2024</h2>
          </div>
          <h3 className="percent">+10%</h3>
          <h1 className="capasity">165 000 л</h1>

          <img className="calendar" src="./calendar.svg" alt="calendar" />
        </div>
        <Switch />

        <div className="table_titles">
          <div className="table_title">фонд</div>
          <div className="table_title">р/л</div>
          <div className="table_title">накопления</div>
        </div>
        <FondElem />
        <hr />
        <FondElem />
        <hr />
        <FondElem />
      </div>
    </div>
  );
};

export default Fonds;
